    },
    {
        title:"Bucket 1",
    },
    {
        title:"Bucket 1",
    },
    {
        title:"Bucket 1",
    },
    {
        title:"Bucket 1",
    },

]

export default function HeadingWithList(props) {
    let { id } = useParams();

    return (
    <div className="container">
        <h1>{props.type}</h1>
        <input placeholder={props.typePlaceholder} type="text"/>
        <ListItems listItems={items}/>
    </div>
    )
}
